package com.MITProjectService.bot.enums;public enum UserEnums {    USER(1),    SERVICE_PROVIDER(2),    ENABLED(1),    LOCKED(2),    DISABLED(3), UNKNOWN(-1);    final int val;    UserEnums(int val) {        this.val = val;    }    public int getVal() {        return val;    }    public  static UserEnums fromVal(int val){        for(UserEnums e : UserEnums.values()){            if(e.getVal() == val){                return e;            }        }        throw new IllegalArgumentException("Invalid user enum");    }}